import { Input,FormControl, FormLabel, VStack } from "@chakra-ui/react";


const Signup = async ()=>{

    return (
      <VStack spacing="10px">
        <FormControl id="name" isRequired>
          <FormLabel>Name</FormLabel>
          <Input
            value={name}
            type="text"
            placeholder="Enter your name"
            onChange={(e) => setName(e.target.value)}
          />
        </FormControl>
      </VStack>
    );
}

export default Signup;
